// filepath: c:\Users\HP\OneDrive\Desktop\caretaker-dashboard\front-end\src\App.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [serverStatus, setServerStatus] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const checkBackendConnection = async () => {
      try {
        // Configure axios defaults
        axios.defaults.baseURL = 'http://localhost:8000';
        axios.defaults.withCredentials = true;
        axios.defaults.headers.common['Content-Type'] = 'application/json';

        const response = await axios.get('/health');
        console.log('Backend response:', response.data);
        setServerStatus(response.data);
        setError('');
      } catch (err) {
        console.error('Backend connection error:', err);
        setError(`Failed to connect to backend server: ${err.message}`);
      }
    };

    checkBackendConnection();
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h1>Caretaker Dashboard</h1>
      {error && (
        <div style={{ 
          color: 'red', 
          padding: '10px', 
          border: '1px solid red',
          borderRadius: '4px',
          marginBottom: '20px'
        }}>
          {error}
        </div>
      )}
      {serverStatus && (
        <div style={{ 
          padding: '10px', 
          border: '1px solid green',
          borderRadius: '4px' 
        }}>
          <h2>Backend Server Status</h2>
          <pre>{JSON.stringify(serverStatus, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
